import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { AdminModule } from './features/admin/admin.module';
import { AuthModule } from "./features/auth/auth.module";
import { AdminsComponent } from './features/admins/admins.component';
import { NavbarComponent } from './features/admins/components/navbar/navbar.component';
import { SidebarComponent } from './features/admins/components/sidebar/sidebar.component';



@NgModule({
    declarations: [
        AppComponent,
        AdminsComponent,
        NavbarComponent,
        SidebarComponent,
    ],
    providers: [],
    bootstrap: [AppComponent],
    imports: [
    BrowserModule,
    AppRoutingModule,
    AuthModule,
    AdminModule

    ]
})
export class AppModule { }
